import React from "react";
import styled from "styled-components";

const home = require("../../../assets/home.png").default;

const Card = styled.div`
  height: 100px;
  width: 200px;
  border: solid;
  text-align: center;
  margin: 30px;
`;

const Icon = styled.img`
  height: 70px;
`;

const Renovate = () => {
  return (
    <Card>
      <Icon src={home} />
      <p>Full Home Renovation</p>
    </Card>
  );
};

export default Renovate;
